import React from "react";

function Record(record){
console.log(record.metric)
return (
    <tr key={record.id}>
        <td>{record.exercise_id}</td>
        <td>{record.metric}</td>
        <td>{record.date_created}</td>
    </tr>
)
}

export default Record;
